import react, {Component} from 'react';
import {BigCircle} from "./create-button.styles";

class CreateButton extends Component {

    render() {
        return (
            <BigCircle>
               <p style={{fontSize:"2em", margin:"0", fontWeight:"light"}}>+</p>
            </BigCircle>
        )
    }
}

export default CreateButton;
